import React from "react";

export default function Navbar() {
  return (
    <div className="flex justify-between w-full">
      <div className="bg-blue-600 w-1/2 py-6 lg:pl-44">
        <img src="/logo/logo.png" alt="" className="h-28" />
      </div>
      <div className="bg-green-600 w-1/2 flex justify-end pr-44 py-14">
        <img src="/logo/menu.png" alt="" className="h-20" />
      </div>
    </div>
  );
}
